snippet.textDisplay:
Indian Music Industry, बॉलीवुड की बौद्धिक बेईमानी का कोई मुकाबला नहीं है!
इस ट्रैक में इस्तेमाल folk मुखड़ा, 'मोरे सैयां जो आए पलट के' exactly नवाब वाजिदअली शाह के रचे 'मोरे कान्हा जो आए पलट के' की copy है पर credit कौसर मुनीर को है
@cokestudioind shame!!

